import React from "react";
import Navbar from "./Components/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";

import Home from "./Components/pages/Home";
import PersonDelete from "./Components/PersonDelete";
import Signup from "./Components/pages/SignUp";
import PersonPut from "./Components/pages/PersonPut";
import Get from "./Components/pages/Get";
import Delete from "./Components/pages/Delete";

function App() {
  return (
    <>
      <Router>
        <Navbar />

        <Switch>
          <Route path="/Home" exact component={Home} />
          <Route path="/List" exact component={Get} />
          <Route path="/" exact component={Signup} />
          <Route path="/two" exact component={PersonPut} />
          <Route path="/three" exact component={Delete} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
